                this.arrOFtikets[i].Counter += 1;
                this.arrOFtikets[i].price = this.arrOFtikets[i].price * this.arrOFtikets[i].Counter;
                this.total = this.total + (this.arrOFtikets[i].price / this.arrOFtikets[i].Counter);
